import React, { Component } from 'react';
import './App.css';
//import Left from './Components/LeftPage'
//import InputT from './Components/InputText'
//import Form from './Components/Form'
import Box from './Components/Box'

class App extends Component {
    state={
      colors:['red','blue','green','yellow']
    }

    getColor=(color)=>
    {
        console.log(color)
    }
    

    render() {
        return (
          <div className="App">
           <div className="App">
            <div className="row">
                <div className="col-3">
                    <Box color="red" getColorFun={this.getColor}></Box>
                </div>    
                <div className="col-3">    
                    <Box color="blue" getColorFun={this.getColor}></Box>
                </div>    
                <div className="col-3">    
                    <Box color="green" getColorFun={this.getColor}></Box>
                </div>
            </div>
        </div>
          </div>
        );
      }
    }

export default App;
